const testInput = 'dabAcCaCBAcCcaDA';

const input = `

`;

function isSameLetterDiffCasing(a, b = '') {
  const isSameLetter = a.toLowerCase() === b.toLowerCase();
  return isSameLetter && a !== b;
}

function reactPolymer(polymer) {
  return [...polymer].reduce((acc, curr) => {
    const indexOfPrev = acc.length - 1;
    const prevLetter = acc[indexOfPrev];

    if (isSameLetterDiffCasing(curr, prevLetter)) {
      return [...acc.splice(0, indexOfPrev), ...acc.splice(indexOfPrev + 1)];
    }

    return [...acc, curr];
  }, []);
}

function getResultOne(input) {
  const trimmed = input.trim();
  return reactPolymer(trimmed).length;
}

function getResultTwo(input) {
  const trimmed = input.trim();

  const chars = Array(26)
    .fill()
    .map((_, i) => {
      const match = new RegExp(String.fromCharCode(i + 65), 'gi');
      const stripped = trimmed.replace(match, '');
      return reactPolymer(stripped);
    });

  return chars.reduce((acc, curr) => {
    const currLength = curr.length;
    return !acc || currLength < acc ? currLength : acc;
  }, 0);
}

const testResultOne = getResultOne(testInput);
console.log(testResultOne);

const testResultTwo = getResultTwo(testInput);
console.log(testResultTwo);

const resultOne = getResultOne(input);
console.log(resultOne);

const resultTwo = getResultTwo(input);
console.log(resultTwo);
